import React from "react";
import car1 from "../../Images/car1.jpg";
import car2 from "../../Images/car2.jpeg";
import car3 from "../../Images/car3.jpg";
import car4 from "../../Images/car4.webp";
import "owl.carousel/dist/assets/owl.carousel.css";
import "owl.carousel/dist/assets/owl.theme.default.css";
import "./Frontpage.css";

export const Frontpage = () => {
  const options = {
    rewind: true,
    autoplay: true,
    margin: 30,
    responsiveClass: true,
    nav: true,
    navText: ["<", ">"],
    smartSpeed: 1000,
    responsive: {
      0: {
        items: 1,
      },
      400: {
        items: 1,
      },
      600: {
        items: 2,
      },
      700: {
        items: 3,
      },
      1000: {
        items: 5,
      },
    },
  };

  return (

    <div id="owl-demo" className="owl-carousel owl-theme">
    <div className="item"><img src={car1} alt="The Last of us" /></div>
    <div className="item"><img src={car2} alt="GTA V" /></div>
    <div className="item"><img src={car3} alt="Mirror Edge" /></div>
  </div>
  

  );
};
